Corruption, cynicism, class presumption and the attendant resentment of the underclass - all packaged in a tidy Columbia programmer. Glenn Ford, as a newsman,  tries to blow the lid off baby peddling and a crooked orphanage that exploits the young and knocked up. Too efficient and to the point for its own good, but admirable in the way it presumes a casually malicious world without ever affecting any malice itself.


